const Board_Header = () => {
  useEffect(() => {
  // eslint-disable-next-line react-hooks/exhaustive-deps
  }, []);
  return (
    <div id="Board-header">
      <div id="logo-container-2">
        <Logo2 check_id={check_id}/>
        <Logo_Name2 />
      </div>
      <div id="profile-container-2">
        <Profile_Pic2 />
      </div>
    </div>
  );
};

export default Board_Header;
